  summary: "\n1. Typically, serves up lines in a string stream as an Enumerator. Useful for composing with other enumerators and operators.\n2. Optionally, can split a line and serves up each individual sub-line as a line in its own right...\n3. We implement line reading directly in here, instead of calling reader.ReadLine. We do so because TextReader\ndoes not correctly handle the presence of \\0 and throws out of memory...\n"
